import logo from './logo.svg';
import React from 'react';
import axios from 'axios';
import './App.css';
import Header from './component/Header';
import Menu from './component/Menu';
import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";
import User from './pages/user';
import House from './pages/house';
import Bill from './pages/bill';
import Dashboard from './pages/dashboard';
import { Provider } from 'react-redux';
import { store } from './setup-redux/store';
import Login from '../src/component/Login';
import PrivateRoute from './PrivateRoute';
import Administrative from './pages/Administarive';
function App() {
  const [data, setData] = React.useState([]);
  React.useEffect(()=>{
    axios.get("https://vapi.vnappmob.com/api/province")
    .then((data)=>{
      console.log(data.data.results);
      setData(data.data.results);
    })
    .catch((err)=>{
      console.log(err);
    })


  },[])
  console.log(data)
  React.useEffect(()=>{
    for(let i=0;i<data.length;i++){
      axios.post("http://localhost:1337/provinces",{
        province_id: data[i].province_id,
        province_name: data[i].province_name,
        province_type: data[i].province_type,
      })
    }

  },[])
  return (
    <Provider store={store}>
      <BrowserRouter>

        <Header />

        <div className="main">
          <div className="menu">
            <Menu />
          </div>
          <div className="views">
            <Switch>
              <Route path="/login" component={Login} />


              <PrivateRoute exact path="/" component={Dashboard} />
              <PrivateRoute path="/users" component={User} />
              <PrivateRoute path="/houses" component={House} />
              <PrivateRoute path="/bills" component={Bill} />
              <PrivateRoute path="/administrative-units" component={Administrative} />

              <Route render={() => <Redirect to="/404" />} />
            </Switch>
          </div>

        </div>
      </BrowserRouter>
    </Provider>
  );
}

export default App;
